import "./App.css";
import logo from "./assets/logo.png";
import people from "./assets/happytable.jpg";
import people2 from "./assets/people2.jpg";
import fish from "./assets/fish.jpg";
import SimpleImageSlider from "react-simple-image-slider";
import wa from "./assets/whatsapp.png";
import phone from "./assets/phone.png";
import location from "./assets/location.png";
import menu from "./assets/menu.jpg";
import item2 from "./assets/d.jpg";
import item3 from "./assets/item2.jpeg";
import item4 from "./assets/item4.jpeg";

function App() {
  const MenuItem = ({ title }) => {
    return (
      <div
        style={{
          fontSize: 16,
          color: "#fff",
          fontWeight: "bold",
          fontFamily: "monospace",
        }}
      >
        {title}
      </div>
    );
  };
  return (
    <div
      className="App"
      style={{ height: "100vh", width: "100vw", backgroundColor: "#000" }}
    >
      {/* header */}
      <div
        style={{
          width: "100%",
          display: "flex",
          flexDirection: "row",
          alignItems: "center",
        }}
      >
        <img src={logo} style={{ height: 80, width: 80, margin: 20 }} />
        <div
          style={{
            color: "#fff",
            fontWeight: "bold",
            fontSize: 30,
            fontFamily: "cursive",
          }}
        >
          Gold Fish
        </div>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            flex: 1,
            height: 50,
            alignItems: "center",
            justifyContent: "flex-end",
            columnGap: 35,
            marginRight: 40,
            cursor: "pointer",
          }}
        >
